the Pandyas, who ruled first from Korkai near present day Tuticorin, before shifting to Madurai, from as early as 600 BC BC had a thriving shipping and trading with Greece and Rome to the Greek and Persian invasions from land and sea. To the massive Chola Empire that spread to the neighbouring countries of South East Asia, The Mauryas in Northern India who conquered most of India except the Tamilians and had great Kings like Chandragupta Maurya and Asoka the Great, The Chera Dynasty from the South, Harshavardhana, The Pallavas, The Rajputs from the Central and North Western India, the Mughals, Sivaji Maharaj and the Marathas, Hyder Ali and Tipu Sultan of Mysore and Rani of Jhansi , Laxmibai.\n\n"},{"text":"00:01","navigationEndpoint":{"clickTrackingParams":"CEAQzasBGAEiEwiK7fS8rpLqAhUGlXsKHaqMCGg=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=Ihd3uh6jUqo\u0026t=1s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"Ihd3uh6jUqo","continuePlayback":true,"startTimeSeconds":1}}},{"text":"  Pandya Dynasty - Indian History | Mocomi Kids\n"},{"text":"01:39","navigationEndpoint":{"clickTrackingParams":"CEAQzasBGAEiEwiK7fS8rpLqAhUGlXsKHaqMCGg=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=Ihd3uh6jUqo\u0026t=99s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"Ihd3uh6jUqo","continuePlayback":true,"startTimeSeconds":99}}},{"text":"  Persian and Greek Invaders | Mocomi Kids\n"},{"text":"03:12","navigationEndpoint":{"clickTrackingParams":"CEAQzasBGAEiEwiK7fS8rpLqAhUGlXsKHaqMCGg=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=Ihd3uh6jUqo\u0026t=192s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"Ihd3uh6jUqo","continuePlayback":true,"startTimeSeconds":192}}},{"text":"  Chola Empire History | Mocomi Kids\n"},{"text":"07:17","navigationEndpoint":{"clickTrackingParams":"CEAQzasBGAEiEwiK7fS8rpLqAhUGlXsKHaqMCGg=","commandMetadata":{"webCommandMetadata":{"url
